Exhibition catalog in The Springs of achievement Series on the Art of Photography. Eugene Cuvelier brought the spirit of mid-nineteenth century landscape painting to the still young medium of photography. His carefully composed and richly printed photographs were admired by the pre-Impressionists, contributing to their vision while drawing inspiration from their paintings.
